webpackJsonp([0xbc7d63d1bec5],{1481:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/ultrashock-v2/index.md absPath of file >>> MarkdownRemark",html:'<p><a title="Open link in a new window" href="http://www.ultrashock.com/" target="_blank"><img class="alignnone size-full wp-image-217" title="ultrashock" src="/content/images/2008/04/ultrashock.jpg" alt="" width="500" height="280" /></a></p>\n<p>Ultrashock is one of those sites whose forums I tend to stumble around quite frequently on the \'net - but I\'ve only recently taken a good look at it. The site itself is pretty impressive you know. It\'s mostly full browser flash, and a few of the interface elements gives away that it\'s based in Flex, presumably with some very custom UI elements.</p>\n<p>There\'s the whole <a title="Open link in a new window" href="http://www.asual.com/swfaddress/" target="_blank">SWFAddress</a> deeplinking going on, Flash and Flex integration, and a very seamless transition to non-Flash elements, like the Forums and Wordpress powered blog. If you\'re looking for a showcase Flex site, here\'s a goodie. <a title="Open link in a new window" href="http://www.thefwa.com/?app=winners&id=6489" target="_blank">FWA</a> thinks so too.</p>\n<p>What\'s more they\'re in the trade of selling content, kinda like FlashDen - which is cool.</p>',frontmatter:{title:"Ultrashock v2",date:"April 24, 2008",tags:["external-links","flash","flex","showcase"]}}},pathContext:{}}}});
